import React from 'react';
import Move from './Move'
import './MovesHistory.css';

class MovesHistory extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            moves: ['Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', 'Bdb8', 'Rdf8', ]
        }
    }

    render() {
        return (
            <section id="MovesHistory">
                <h3>Session History</h3>
                <hr />
                {this.state.moves.map((move, id) => <Move key={id} value={move} />)}
            </section>
        );
    }
}

export default MovesHistory;
